import React from 'react';
export default function MyComponent (props) {
  function showCategory(e) {
 const updateCategory = e.target.value
   {props.updateCategory.map((item) => {
    return (
      <>
      <div key={item}>
        <button value={item} onClick={showCategory}> 


        </button>
     </div>
     </>
    )
   })}

  return (
    <div key={item}
      style={{
        backgroundImage: `url("https://t4.ftcdn.net/jpg/03/45/88/07/360_F_345880772_zIT2mkdCzTthplO7xqaGGrMspN0jw0ll.jpg")`,
        backgroundSize: 'cover',
        backgroundRepeat: 'no-repeat',
        backgroundPosition: 'center',
        width: '100%',
        height: '100vh', 
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
      }}
    >
      <div
        style={{
          backgroundColor: 'rgba(255, 255, 255, 0.8)',
          padding: '20px',
          borderRadius: '10px',
          boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
          textAlign: 'center',
        }}
      >
        <h2>quiz</h2>
        <button
          style={{
            padding: '10px 20px',
            fontSize: '16px',
            borderRadius: '5px',
            cursor: 'pointer',
          }}

          onClick={showCategory}

        >
          Start
        </button>
      </div>
    </div>
  );


};
}
